import React from 'react';
import PropTypes from 'prop-types';


const Testa = (props) => {
    
    return (
        <div className="taskItem">
        <label> Title </label>
        <label> Creator</label>
        <label> Status</label>
        <p>
          Desscription: <br />
        </p>
      </div>

    )
};
Testa.propTypes  = {
  tit : PropTypes.string,
};

export default Testa;
